DELETE_VIDEO:{TITLE:"Hogyan t\u00f6r\u00f6lhetek le egy vide\u00f3t?",TEXT:"Egy vide\u00f3 a saj\u00e1t inform\u00e1ci\u00f3s oldal\u00e1n kereszt\u00fcl t\u00f6r\u00f6lhet\u0151 le. Itt v\u00e1lassza ki a F\u00e1jlok kezel\u00e9se opci\u00f3t majd pedig kattintson a piros szemeteskos\u00e1r ikonra. Egy m\u00e1sik lehet\u0151s\u00e9g a Film szerkeszt\u00e9se men\u00fcponton bel\u00fcl a Film t\u00f6rl\u00e9se opci\u00f3. A F\u00e1jlok kezel\u00e9se men\u00fcpont is haszn\u00e1lat\u00f3, ami a Tartalom kezel\u00e9se men\u00fcn bel\u00fcl tal\u00e1lhat\u00f3. Itt l\u00e1that\u00f3 az \u00f6sszes felt\u00f6lt\u00f6tt tartalom, ahol ism\u00e9t a piros szemeteskos\u00e1rra kattintva t\u00f6r\u00f6lhet\u0151 egy kiv\u00e1lasztott f\u00e1jl."},
VIDEO_FORMATS:{TITLE:"Melyek a t\u00e1mogatott vide\u00f3form\u00e1tumok?",TEXT:"A Streama jelenleg csak a HTML5 \u00e1ltal is t\u00e1mogatott vide\u00f3form\u00e1tumokat t\u00e1mogatja. Egy vide\u00f3f\u00e1jl kompatibilit\u00e1sa tesztelhet\u0151 amennyiben a kiv\u00e1lasztott f\u00e1jlt egy kattint\u00e1ssal beleh\u00fazza egy \u00fcres b\u00f6ng\u00e9sz\u0151ablakba (drag and drop)."},SUBTITLES:{TITLE:"Hogyan adhatok feliratot egy vide\u00f3hoz?",TEXT:"Feliratok a F\u00e1jlok kezel\u00e9se gombra kattint\u00e1s ut\u00e1n, a vide\u00f3 inform\u00e1ci\u00f3s oldal\u00e1n adhat\u00f3k hozz\u00e1. Ide egy kattint\u00e1ssal beh\u00fazhat\u00f3ak a feliratf\u00e1jlok (drag and drop). Mindeddig a megfelel\u0151 form\u00e1tumba kellett konvert\u00e1lni a f\u00e1jlokat, de ez t\u00f6bb\u00e9 m\u00e1r nem sz\u00fcks\u00e9ges. Az alkalmaz\u00e1s ezt mostant\u00f3l megteszi \u00f6n helyett."},
INVITE_USERS:{TITLE:"Hogyan h\u00edvhatom meg ismer\u0151seimet, hogy megn\u00e9zhess\u00e9k a megoszott vide\u00f3imat?",TEXT:"A filmek megoszt\u00e1s\u00e1hoz meg kell hogy h\u00edvja ismer\u0151seit az \u00f6n \u00e1ltal futtatott Streama-ra. Menjen a Felhaszn\u00e1l\u00f3k men\u00fcbe majd pedig kattintson a Felhaszn\u00e1l\u00f3 megh\u00edv\u00e1sa gombra. T\u00f6ltse ki a megfelel\u0151 mez\u0151ket \u00e9s adja meg a megh\u00edvott szem\u00e9ly beoszt\u00e1s\u00e1t. Adminisztr\u00e1tor szint\u0171 felhaszn\u00e1l\u00f3k szerkeszthetik m\u00e1s felhaszn\u00e1l\u00f3k be\u00e1ll\u00edt\u00e1sait illetve \u00faj felhaszn\u00e1l\u00f3kat is be\u00e1ll\u00edthatnak. Felhaszn\u00e1l\u00f3k a Tartalomkezel\u0151 beoszt\u00e1sban pedig szerkeszthetik a felt\u00f6lt\u00f6tt tartalmakat. Az ismer\u0151sei emailben kapj\u00e1k meg a megh\u00edv\u00e1st. Ezen  fel\u00fcl, kiv\u00e1lasztott (egyedi) vide\u00f3 \u00fcl\u00e9seket is megoszthat ismer\u0151seivel amennyiben a vide\u00f3lej\u00e1tsz\u00f3 Megoszt\u00e1s gombj\u00e1ra kattint majd tov\u00e1bb\u00edtja a kapot URL-t nekik."},
BASE_URL:{TITLE:"Mi az alap\u00e9rtelmezett URL \u00e9s hogyan \u00e1ll\u00edtsam be?",TEXT:"Az alap\u00e9rtelmezett URL a megh\u00edv\u00f3 emailekn\u00e9l j\u00e1tszik szerepet ahol a Streama szerver c\u00edm\u00e9t mutatja."},NOTIFICATIONS:{TITLE:"Mik azok az \u00fczenetek?",TEXT:"A felt\u00f6lt\u00f6tt vid\u00f3kr\u00f3l \u00e9rtesit\u0151 \u00fczenetet k\u00fcldhet ismer\u0151seinek. Ehhez adjon hozz\u00e1 egy \u00faj kimen\u0151 \u00fczenetet az \u00d9j \u00fczenet gombra kattinva, amely a vide\u00f3 inform\u00e1ci\u00f3s oldal\u00e1n tal\u00e1lhat\u00f3. Az \u00fczenet elk\u00fcld\u00e9s\u00e9hez nyissa meg az \u00dczenetek men\u00fcpontot majd pedig kattintson az \u00dczenetek elk\u00fcld\u00e9se gombra."},
VIDEO_PLAYER_SHORTCUTS:{TITLE:"Vannak a vide\u00f3lej\u00e1tsz\u00f3nak el\u00e9rhet\u0151 gyorsbillenty\u0171 kombin\u00e1ci\u00f3i?",TEXT:"Igen, ezek a k\u00f6vetkez\u0151k. Sz\u00fcnet/folytat\u00e1s: sz\u00f6vegk\u00f6z. Hanger\u0151 szab\u00e1lyoz\u00e1sa: felfel\u00e9s \u00e9s lefel\u00e9 nyilak. R\u00f6vid ugr\u00e1s el\u0151re/vissza: balra \u00e9s jobbra nyilak. Hosszabb ugr\u00e1s el\u0151re/vissza: Ctrl + balra \u00e9s jobbra nyilak. Teljes k\u00e9perny\u0151 be/ki: Alt + Enter. Feliratok ki/be: S. N\u00e9m\u00edt\u00e1s: M. Visszat\u00e9r\u00e9s az el\u0151z\u0151 k\u00e9perny\u0151h\u00f6z: Delete vagy Backspace."},
